def vowels_count(s):
    vowels = {'a', 'e', 'i', 'o', 'u'}
    count = 0
    for i, char in enumerate(s.lower()):
        if char in vowels:
            count += 1
        elif char == 'y' and i == len(s) - 1:
            count += 1
    return count

def pluck(arr):
    min_even = float('inf')
    min_index = -1
    for i, num in enumerate(arr):
        if num % 2 == 0 and num < min_even:
            min_even = num
            min_index = i
    return [min_even, min_index] if min_even != float('inf') else []

def search(lst):
    from collections import Counter
    freq = Counter(lst)
    for num in sorted(freq.keys(), reverse=True):
        if freq[num] >= num:
            return num
    return -1

def triangle_area(a, b, c):
    if a + b > c and a + c > b and b + c > a:
        s = (a + b + c) / 2
        area = (s * (s - a) * (s - b) * (s - c)) ** 0.5
        return round(area, 2)
    else:
        return -1

def smallest_change(arr):
    n = len(arr)
    changes = 0
    for i in range(n // 2):
        if arr[i] != arr[n - 1 - i]:
            changes += 1
    return changes

def is_multiply_prime(a):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5)+1):
            if n % i == 0:
                return False
        return True

    primes = [i for i in range(2, a) if is_prime(i)]
    for p1 in primes:
        if p1 > a:
            break
        for p2 in primes:
            if p1 * p2 > a:
                break
            for p3 in primes:
                if p1 * p2 * p3 == a:
                    return True
    return False

def is_simple_power(x, n):  
    if n == 1:  
        return x == 1  
    low = 0  
    high = x  
    while low <= high:  
        mid = (low + high) // 2  
        power = n ** mid  
        if power == x:  
            return True  
        elif power < x:  
            low = mid + 1  
        else:  
            high = mid - 1  
    return False

def iscube(a):
    if a < 0:
        a = -a
    root = round(a ** (1/3))
    return root ** 3 == a or (root + 1) ** 3 == a or (root - 1) ** 3 == a

def hex_key(num):
    primes = {'2', '3', '5', '7', 'B', 'D'}
    return sum(1 for c in num if c in primes)
